import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import Timer from "../components/Timer";
import QuestionCard from "../components/QuestionCard";
import Loader from "../components/Loader";
import { generateMCQs } from "../utils/openai";

export default function TestPage() {
  const navigate = useNavigate();
  const [config, setConfig] = useState(null);
  const [questions, setQuestions] = useState(null);
  const [loading, setLoading] = useState(true);
  const [currentIndex, setCurrentIndex] = useState(0);
  const [answers, setAnswers] = useState({});
  const [paused, setPaused] = useState(false);
  const [timeExpired, setTimeExpired] = useState(false);

  // Load config from localStorage
  useEffect(() => {
    const cfg = localStorage.getItem("mockConfig");
    console.log("Loaded config from localStorage:", cfg);
    if (!cfg) {
      alert("No test config found. Redirecting to home.");
      navigate("/");
      return;
    }
    try {
      const parsedCfg = JSON.parse(cfg);
      setConfig(parsedCfg);
    } catch (err) {
      console.error("Failed to parse config JSON:", err);
      alert("Invalid config found. Redirecting to home.");
      navigate("/");
    }
  }, [navigate]);

  // Fetch questions based on config
  useEffect(() => {
    if (!config) return;

    async function fetchQuestions() {
      setLoading(true);
      try {
        console.log("Sending request to generateMCQs with config:", config);
        const rawQuestions = await generateMCQs({
          topics: config.topics,
          questionCount: Number(config.questionCount),
          difficulty: config.difficulty,
          type: config.type,
        });
        console.log("Raw questions response from API:", rawQuestions);

        // Parse JSON
        const parsed = JSON.parse(rawQuestions);
        console.log("Parsed questions:", parsed);
        setQuestions(parsed);
      } catch (error) {
        console.error("Error fetching questions:", error);
        alert("Failed to load questions. Try again.");
        navigate("/");
      } finally {
        setLoading(false);
      }
    }

    fetchQuestions();
  }, [config, navigate]);

  function setAnswerForCurrent(ans) {
    console.log(`Saving answer for question ${currentIndex}:`, ans);
    setAnswers((prev) => ({
      ...prev,
      [currentIndex]: ans,
    }));
  }

  function nextQuestion() {
    if (currentIndex < questions.length - 1) {
      console.log(`Moving from question ${currentIndex} to ${currentIndex + 1}`);
      setCurrentIndex(currentIndex + 1);
    }
  }
  function prevQuestion() {
    if (currentIndex > 0) {
      console.log(`Moving back from question ${currentIndex} to ${currentIndex - 1}`);
      setCurrentIndex(currentIndex - 1);
    }
  }

  function submitTest() {
    console.log("Submitting test with answers:", answers);
    localStorage.setItem(
      "mockResult",
      JSON.stringify({ answers, questions, config })
    );
    navigate("/result");
  }

  if (loading) return <Loader />;

  if (timeExpired) {
    alert("Time is up! Test will be submitted automatically.");
    submitTest();
    return null;
  }

  if (!questions) {
    return <div className="container py-5">No questions available.</div>;
  }

  return (
    <div className="container py-4">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <Timer
          durationMinutes={config.duration}
          paused={paused}
          onExpire={() => {
            console.log("Timer expired");
            setTimeExpired(true);
          }}
        />
        <div>
          <button
            className="btn btn-warning me-2"
            onClick={() => setPaused((p) => !p)}
          >
            {paused ? "Resume" : "Pause"}
          </button>
          <button className="btn btn-danger" onClick={submitTest}>
            Submit Test
          </button>
        </div>
      </div>

      <QuestionCard
        question={questions[currentIndex]}
        index={currentIndex}
        total={questions.length}
        userAnswer={answers[currentIndex] || []}
        setUserAnswer={setAnswerForCurrent}
        type={config.type}
      />

      <div className="d-flex justify-content-between mt-3">
        <button
          className="btn btn-secondary"
          onClick={prevQuestion}
          disabled={currentIndex === 0}
        >
          Previous
        </button>
        <button
          className="btn btn-secondary"
          onClick={nextQuestion}
          disabled={currentIndex === questions.length - 1}
        >
          Next
        </button>
      </div>
    </div>
  );
}
